measurements.description:
One hundred twenty-four stellate white flowers and 18 buds on 15 arching to pendant up to 16-cm inflorescences;
 plant 21-cm wide by 31-cm tall, mounted on 14-cm wide by 27-cm tall cork slab; 
 sepals lanceolate, slightly reflexed apically ; 
 petals acuminate, slightly reflexed apically; 
 lip trilobed, midlobe narrowly acute, side lobe margins denticulate, spur 4.0-cm long; 
 anther cap yellow; substance firm; texture crystalline; citrus fragrance noted, plant nearly obscured by inflorescences,
natural spread vertical includes spur, also received award 20255296.
